import React from "react";
import "./home.css";

function Home() {
  return (
    <div className="container-home">
      <div className="content-home">
        <div className="sidebar">
          <div>
            <p>Fenomenler</p>
            <a href="/product">Donanım Arşivi</a>
          </div>
        </div>
        <div className="product-home">
          <p>Son eklenen ürünler</p>
          <div className="product-home-box"></div>
        </div>
      </div>
    </div>
  );
}

export default Home;
